            height: "70vh"
          }}
        >
          <Grid container xs={24}>
            {this.state.cards.map(card => (
              <Grid item xs={3}>
                <CardDisplay
                  key={card}
                  LocalcarrierCode={card}
                  selected={true}
                />
              </Grid>
            ))}

            <Grid item xs={3}>
              <Fab
                size="large"
                aria-label="Add"
                onClick={this.handle}
                className={classes.fab}
              >
                <AddIcon />
              </Fab>
            </Grid>
          </Grid>
        </div> */}
        {/* <Button
          className={classes.clearButton}
          variant="outlined"
          color="secondary"
          onClick={this.clear}
        >
          Delete
        </Button> */}
      </div>
    );
  }
}
